import React, {Component} from "react";

class Cooking extends Component {
    constructor() {
        super()
        this.state = {}
    }

    componentDidMount() {
        fetch("https://newsapi.org/v2/everything?q=tesla&from=2021-06-26&sortBy=publishedAt&apiKey=")
        .then(response => response.json())
        .then(data => console.log(data))
    }

    render() {
        return (
            <div></div>
        )
    }
}

export default Cooking
